import React from 'react'
import txt from './file.txt';

function TextBox(props){
    
        return(
            <div className="offset-1">
                <h1>{props.text}</h1>
                <div>
                    <input type='text'/>
                </div>
                <div>
                    <button onClick={props.onClick}>Vaihda Teksti</button>
                </div>
            </div>
        )
}

export default TextBox
